import React, { Component } from 'react';
import axios from 'axios';
import { NavLink } from 'react-router-dom';
class NewCard extends Component {
    componentDidMount() {
        axios.get(`http://localhost:64430/api/Enterprises`).then(x => {
            console.log(x.data);
            this.setState({ stores: x.data })
            console.log(this.state.stores);
        });
    }
    state = {
        stores: [],
    }
    render() {
        return (
            <div>
                {this.state.stores.map((x, i) => {
                    return (
                        <div key={i}>
                            <br></br>
                    <a href="https://www.myofficeguy.com/f69723755/" target="_blank">{x.Name}</a>
                        </div>)
                })}
            </div>
        )
    }
}
export default NewCard;
